function printInvoice(){
    window.print();
}
document.getElementById("downloadButton").addEventListener("click", function() {
    // Generate a data URL for the invoice file (replace 'invoice.pdf' and 'data_url_here' with actual data)
    const invoiceBase64Data = "data:application/pdf;base64,";
    const invoiceDataURL = encodeURI(invoiceBase64Data);
    // Replace with the actual data URL

    // Create an anchor element to trigger the download
    const downloadLink = document.createElement("a");
    downloadLink.href = invoiceDataURL;
    downloadLink.download = "invoice.pdf"; // Replace with the desired filename

    // Trigger a click event on the anchor element to start the download
    downloadLink.click();
});